import './styles.css';

function Outcome({ gameStatus, turns, resetFunction }) {
  if (gameStatus === '') {
    return null;
  }


  if (gameStatus === 'Win') {
    return (
      <div className="outcome-modal">
        <div className="modal-content">
          <p>You won in x turns!</p>
          <button>Play again?</button>
        </div>
      </div>
    );
  }

  if (gameStatus === 'Lose') {
    return (
      <div className="outcome-modal">
        <div className="modal-content">
          <span className="close" onClick={onClose}>
            &times;
          </span>
          <p>You lost? lol dumbass.</p>
          <button>Play again?</button>
        </div>
      </div>
    );
  }
}


export default Outcome;
